■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>陶芸やパン焼きなど高温窯での作業、溶接作業に最適。</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/4988an-01.jpg" width="480" height="640"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">■ファルテッコーは、ケブラー素材を使用したアーム・プロテクターです。手首、腕を切創及び熱からガードします。<br><br>■アームプロテクターを装着後、手袋をすることにより、危険であった手首をしっかりガードし、ズレてくる心配はありません。<br><br>■車のエンジンルームの作業、工業機械等の取扱い時に袖の巻き込み防止、陶芸などの窯での作業、溶接作業、園芸作業などのお手伝いを致します。<br><br>■ケブラー繊維は、500℃まで耐えられるハイテク繊維であり、溶けたり、皮膚に付着することはありませんが、熱を遮断する機能はございません。ご使用中は充分注意願います。<br><br><br>■使用上の注意<br>・濡れた状態では使用しないでください。<br>・酸及びアルカリによって手袋が劣化することがありますので、ご注意ください。<br>・紫外線により変色します。ご使用後は光から防いで保管してください。<br>・洗濯後は影干しにしてください<br>・表・裏の区別はありません。どちらを使用していても効力は一緒です。</font></td></tr></table><br><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/4988an-02.jpg" width="600" height="450"></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0342/4988an-03.jpg" width="600" height="175"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">ファルテッコーは、100％ケプラー素材を使用したアーム・プロテクター。手首、腕を切創及び熱からガードします!</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">ファルテッコーは、100％ケプラー素材を使用したアーム・プロテクター。手首、腕を切創及び熱からガードします!</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#6