壁裏材(間柱等)の中心を探る探知器です。<br />●壁裏の間柱(金属製、木材)の位置が探知できます。<br />●通電状態の電線を探知できます。<br />●見やすいLED表示と電子音でわかりやすく知らせます。<br />●本体は、衝撃耐久性に優れています。<br />●けがき位置を点灯するため、暗い場所でも走査できます。<br />●スタッドセンサー PRO SLは屋内の壁専用に設計されており、探知可能な深さは厚さ、密度、及び水分に影響されます。<br />●質量：120g(電池を含む)<br />●電池寿命：標準仕様状態で100時間<br />●温度範囲：(動作時)-7℃～49℃、(保管時)-29℃～66℃。許容作動湿度：80％ RH(結露なし)以下<br />●9V角型電池<br />●スイッチに配線されているケーブルは配線方法によって、通電状態でも感知しない場合があります。事前に確認して、元の電源を切り作業してください。断線、ショートの恐れがあります。<br />●金属を含む材料で覆われた壁や金属製の電線管内の電圧は探知できません。また合板などの高密度な建材(合板等で裏打ちされている石膏ボード)や、厚い壁材を介しては、電圧を探知できないことがあります。<br />●樹脂製や金属製の電線管が壁の裏面に接触している場合、柱等の探知と同様の反応を示すことがあります。このような電気配線が含まれている壁、床、天井の釘打ちや切断または穴あけ作業においては、特に注意が必要となります。<br />●コンクリート床スラブへの貫通穴の施工を目的とした鉄筋や配管の探知には使用しないでください。鉄筋が集中していたり、配管が湾曲しているため、正確な位置を探知できないことがあります。<br />1回のご購入合計金額(税込)が【5,400円以上】の場合は送料無料です。<br />一部商品（重量物や長尺物など）や、離島および一部遠隔地へのお届けには、別途送料がかかる<br />場合があります。<br />1回のご購入合計金額(税込)が【5,400円未満】の場合は送料がかかります。<br />送料は全国一律540円(重量10kgまで)、沖縄県は10kgまで1,620円を申し受けます。<br />一部商品（重量物や長尺物など）や、離島および一部遠隔地へのお届けには、別途送料がかかる<br />場合があります。●メーカー:ネグロス電工<br />●型式:SCANS<br />●附属品:9V角型電池<br /><br />●出荷目安:5営業日以内<br><br>


